css:
.sheet-toolbar {
  border-bottom: none;
  box-shadow: 0 0 0.5px #313236, 0 1px 1.5px #313236, 0 0 3px #313236;
}
.thread-icon:not(.thread-icon-unread):not(.thread-icon-star) {
  -webkit-filter: invert(100%);
}
img.content-dark {
  -webkit-filter: invert(100%);
}
img.content-light {
  -webkit-filter: invert(100%);
}
.popover {
  border: 1px solid #313236;
}
.mail-label {
  -webkit-filter: contrast(110%) brightness(85%);
}
.autoload-images-header {
  background-color: #5c5331;
  border: 1px solid #322a0c;
  color: rgba(236, 202, 74, 0.92);
  margin: 5px 0;
  padding: 5px 12px;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
}
.autoload-images-header .option {
  color: rgba(209, 200, 152, 0.7);
}
.autoload-images-header .option:hover {
  color: rgba(209, 200, 152, 0.84);
}
